import styled from "@emotion/styled";
import { Navbar } from '../navigation/Navbar';
import { Footer } from '../../component/Footer';

const Container = styled.div`
  height: 35rem;
  width: 100%;
  padding: 3rem 8rem;
  background-color: rgb(222, 222, 222);
`;

export const PromotionPage = () => {
  return (
    <Container>
      <Navbar />
      <h1>Test</h1>
      <Footer />

    </Container>
  )
}
